Since trait is really just a normal NBT in an item. When you want to create a custom item you just need to attach the ctc field to it as well. /give @s diamond_sword{CustomModelData: 1234567, ctc: {id: 'light_saber', from: 'example:light_saber', traits: {'tool/weapon': 1b, 'metal/platinum': 1b}}, display: {Name: 'Light Saber'} }
# ^^^^^^^ ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^
# ^ You might want your custom item to have a custom texture ^
# ^ The ctc field Or you can specify it in the loot table form like this { "pools": [ { "rolls": 1, "entries": [ { "type": "minecraft:item", "name": "minecraft:diamond_sword", "functions": [ { "function": "minecraft:set_nbt", "tag": "{CustomModelData: 1234567}" }, { "function": "minecraft:set_nbt", "tag": "{ctc: {id: 'light_saber', from: 'example:light_saber', traits: {'tool/weapon': 1b, 'metal/platinum': 1b}}}" } ] } ] } ]
}
